import timeit

class Solution:
    def threeSum(self, nums):
        """
        :type nums: List[int]
        :rtype: List[List[int]]
        """
        if len(nums) < 3:
            return []
        
        # remove duplicate num (duplicate count > 3)
        buff = {}
        new_nums = []
        for i in nums:
            if i in buff and buff[i] < 3:
                buff[i] = buff[i] + 1
                new_nums.append(i)
            else:
                buff[i] = 1
                new_nums.append(i)
        new_nums.sort()
        
        ret = []
        for i in range(len(new_nums) - 2):
            if i > 0 and new_nums[i-1] == new_nums[i]: continue
            left = i + 1
            right = len(new_nums) - 1
            while left < right:
                s = new_nums[i] + new_nums[left] + new_nums[right]
                if s == 0:
                    ret.append([new_nums[i], new_nums[left], new_nums[right]])
                    left += 1
                    right -= 1
                    while left < right and new_nums[left] == new_nums[left - 1]: 
                        left += 1
                    while left < right and new_nums[right] == new_nums[right+1]:
                        right -= 1
                elif s > 0:
                    right -= 1
                else:
                    left += 1
        return ret
                    
